import{_ as t,c as e,o as a,ae as r}from"./chunks/framework.BtEkjhVd.js";const u=JSON.parse('{"title":"Frequently Asked Questions (FAQ)","description":"","frontmatter":{},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),l={name:"faq.md"};function s(i,o,n,c,h,d){return a(),e("div",null,o[0]||(o[0]=[r('<h1 id="frequently-asked-questions-faq" tabindex="-1">Frequently Asked Questions (FAQ) <a class="header-anchor" href="#frequently-asked-questions-faq" aria-label="Permalink to &quot;Frequently Asked Questions (FAQ)&quot;">​</a></h1><p>Here are some common questions and answers to help you use the <strong>Research Data Collector Platform</strong> effectively.</p><h2 id="_1-what-is-the-research-data-collector-platform" tabindex="-1">1. What is the Research Data Collector Platform? <a class="header-anchor" href="#_1-what-is-the-research-data-collector-platform" aria-label="Permalink to &quot;1. What is the Research Data Collector Platform?&quot;">​</a></h2><p>The <strong>Research Data Collector Platform</strong> is a web-based tool designed for researchers to create surveys, collect data from participants, and analyze the results. It supports collecting multiple data types such as text, images, audio, and video, and can work offline.</p><h2 id="_2-how-do-i-reset-my-password" tabindex="-1">2. How do I reset my password? <a class="header-anchor" href="#_2-how-do-i-reset-my-password" aria-label="Permalink to &quot;2. How do I reset my password?&quot;">​</a></h2><p>If you forget your password, follow these steps:</p><ol><li>Go to the login page: <a href="https://www.rdcp.live" target="_blank" rel="noreferrer">https://www.rdcp.live</a>.</li><li>Click on <strong>&quot;Forgot your password?&quot;</strong> link below the login form.</li><li>Enter your registered email address, and you will receive an email with a link to reset your password.</li></ol><h2 id="_3-how-do-i-create-a-new-project" tabindex="-1">3. How do I create a new project? <a class="header-anchor" href="#_3-how-do-i-create-a-new-project" aria-label="Permalink to &quot;3. How do I create a new project?&quot;">​</a></h2><p>To create a new project:</p><ol><li>Log in to the platform.</li><li>On the <strong>Projects</strong> page, click the <strong>New Project</strong> button.</li><li>Enter a name for your project and optionally add a description.</li><li>Click <strong>Create</strong> to save the project.</li></ol><h2 id="_4-can-i-collect-data-offline" tabindex="-1">4. Can I collect data offline? <a class="header-anchor" href="#_4-can-i-collect-data-offline" aria-label="Permalink to &quot;4. Can I collect data offline?&quot;">​</a></h2><p>Yes, the platform supports offline data collection. You can create forms, go to the field, and collect data even without an internet connection. Once you&#39;re back online, the collected data will sync automatically.</p><h2 id="_5-how-do-i-export-the-collected-data" tabindex="-1">5. How do I export the collected data? <a class="header-anchor" href="#_5-how-do-i-export-the-collected-data" aria-label="Permalink to &quot;5. How do I export the collected data?&quot;">​</a></h2><p>To export the collected data:</p><ol><li>Navigate to the <strong>Forms</strong> section of your project.</li><li>Select the form for which you want to export responses.</li><li>Click on <strong>Responses</strong>.</li><li>Use the <strong>Export to CSV</strong> button to download the responses in CSV format for further analysis.</li></ol><h2 id="_6-how-do-i-share-a-form-with-participants" tabindex="-1">6. How do I share a form with participants? <a class="header-anchor" href="#_6-how-do-i-share-a-form-with-participants" aria-label="Permalink to &quot;6. How do I share a form with participants?&quot;">​</a></h2><p>You can share the form with participants by:</p><ol><li>Navigating to the <strong>Forms</strong> section of your project.</li><li>Click the <strong>Copy Link</strong> button next to the form you want to share.</li><li>Share the link with participants via email or any other communication platform.</li></ol><h2 id="_7-can-i-add-collaborators-to-a-project" tabindex="-1">7. Can I add collaborators to a project? <a class="header-anchor" href="#_7-can-i-add-collaborators-to-a-project" aria-label="Permalink to &quot;7. Can I add collaborators to a project?&quot;">​</a></h2><p>Yes, you can add collaborators to your project:</p><ol><li>Open the project settings.</li><li>Click <strong>Add Collaborators</strong>.</li><li>Enter the email addresses of registered users and assign them roles.</li><li>Save the changes to add the collaborators to the project.</li></ol><h2 id="_8-how-do-i-publish-a-form" tabindex="-1">8. How do I publish a form? <a class="header-anchor" href="#_8-how-do-i-publish-a-form" aria-label="Permalink to &quot;8. How do I publish a form?&quot;">​</a></h2><p>To publish a form:</p><ol><li>Go to the <strong>Forms</strong> section of your project.</li><li>Select the form you want to publish.</li><li>Click the <strong>Publish</strong> button to make the form live and available for participants.</li></ol><h2 id="_9-how-do-i-contact-support-if-i-have-issues" tabindex="-1">9. How do I contact support if I have issues? <a class="header-anchor" href="#_9-how-do-i-contact-support-if-i-have-issues" aria-label="Permalink to &quot;9. How do I contact support if I have issues?&quot;">​</a></h2><p>If you have any issues using the platform, you can contact support by sending an email to <strong>support@rdcp.live</strong> or by using the <strong>Help</strong> section in the platform.</p>',26)]))}const f=t(l,[["render",s]]);export{u as __pageData,f as default};
